/**
 * Simplest possible template in AngularJs-ISH style
 *
 * @param {String} template - template string
 * @param {Object} ctx - template context
 * @param {Object} eventHandlerObject - object that will be used as "this" in event handling
 * @returns {Node} returns dom node element
 */
export default function angularish(template, ctx, eventHandlerObject) {
    var node;
    var container = document.createElement('div');

    container.innerHTML = template;

    var walker = document.createTreeWalker(container, NodeFilter.SHOW_ELEMENT, null, false);
    while (node = walker.nextNode()) {

        // inheritance of context
        node.ctx = node.ctx || node.parentNode.ctx || ctx;

        // ng-scope allows you to change scope of the node (new scope can be any property of old scope)
        if (node.getAttribute('ng-scope')) {

            node.ctx = _getValue(node.ctx, node.getAttribute('ng-scope'));

        }
        // ng-loop will repeat first child (TODO: reapeat content) and assign correct context
        if (node.getAttribute('ng-loop')) {

            var child = node.children[0];
            var array = _getValue(node.ctx, node.getAttribute('ng-loop')) || [];
            node.removeChild(child);
            array.forEach((item) => {
                child = child.cloneNode(true);
                child.ctx = item;
                node.appendChild(child);
            });

        }
        // ng-value will assign value to node
        if (node.getAttribute('ng-value')) {

            node.value = _getValue(node.ctx, node.getAttribute('ng-value'));

        }
        // ng-selected will set selected attribute depending on true-finess of value
        if (node.getAttribute('ng-selected')) {

            var selected = _getValue(node.ctx, node.getAttribute('ng-selected'));
            if (selected) {
                node.setAttribute('selected', 'yes');
            }

        }
        // ng-text will assign text to node no need for escaping
        if (node.getAttribute('ng-text')) {

            node.innerText = _getValue(node.ctx, node.getAttribute('ng-text'));

        }
        // ng-class will simply assign class from defined property
        if (node.getAttribute('ng-class')) {

            var classVal = _getValue(node.ctx, node.getAttribute('ng-class'));
            if (classVal) {
                node.className += ' ' + classVal;
            }

        }
        // ng-show shows elements depending on true-finess of the value
        if (node.getAttribute('ng-show')) {

            var isVisible = _getValue(node.ctx, node.getAttribute('ng-show'));
            if (!isVisible) {
                node.style.display = 'none';
            }

        }
        // ng-hide shows elements depending on false-iness of the value
        if (node.getAttribute('ng-hide')) {

            var isHidden = _getValue(node.ctx, node.getAttribute('ng-hide'));
            if (isHidden) {
                node.style.display = 'none';
            }

        }
        // ng-change will add "change" event handler
        if (node.getAttribute('ng-change')) {
            // closure to rescue
            ((node)=> {
                node.addEventListener('change', (event) => {
                    eventHandlerObject[node.getAttribute('ng-change')].bind(eventHandlerObject)(node.ctx, event);
                }, true);
            })(node);
        }
        // ng-click will add "click" event handler
        if (node.getAttribute('ng-click')) {
            // closure to rescue
            ((node)=> {
                node.addEventListener('click', (event) => {
                    eventHandlerObject[node.getAttribute('ng-click')].bind(eventHandlerObject)(node.ctx, event);
                }, true);
            })(node);
        }
    }

    return container;
}

function _getValue(ctx, attrVal) {
    if (attrVal === 'self') {
        return ctx;
    }

    return ctx[attrVal];
}

import Observer from './observer.js'
import angularish from './angularish.js'

export default class AngularishView extends Observer {
    onUpdate(data) {
        if (!this.viewName) {
            throw 'viewName field is required';
        }
        if (!this.template) {
            throw 'template is required';
        }

        var element = document.querySelector('.' + this.viewName);
        if (element) {
            // simplest way to remove all dom elements, ugly - but simple :)
            element.innerHTML = '';
            element.appendChild(angularish(this.template, data, this));
        } else {
            throw 'element with class viewName must be in the DOM';
        }
    }
}

import SimplePromise from './simplepromise.js'

/**
 * Simplest fetch polyfill that returns {@link SimplePromise} witch resolves into {@link FetchResponse}
 *
 * @see https://developer.mozilla.org/en-US/docs/Web/API/GlobalFetch/fetch
 * @param {String} url - target url
 * @param {{method: String, async: boolean, timeout: Number}} [options] - options that will configure request
 * @return {SimplePromise} returns a SimplePromise
 *
 * @example
 * fetch('/data').then((response) => {
 *     this.viewmodel.update(response.data);
 * }).fail((error) => {
 *     this.viewmodel.show_notification(error);
 * })
 */
export default function fetch(url, {method = 'GET', async = true, timeout = 10000} = {}) {
    var promise = new SimplePromise();

    // since we don't need to support legacy browsers we will use
    // standard XMLHttpRequest
    var xhr = new XMLHttpRequest();
    xhr.open(method, url, async);
    xhr.timeout = timeout;
    xhr.onreadystatechange = () => {
        if (xhr.readyState === xhr.DONE) {
            if ([200, 201].indexOf(xhr.status) > -1) {
                promise.resolve(new FetchResponse({
                    status: xhr.status,
                    data: _processResponse(xhr)
                }));
            } else {
                promise.reject(new FetchResponse({
                    status: xhr.status,
                    error: _processResponse(xhr)
                }));
            }
        }
    };
    xhr.ontimeout = () => {
        promise.reject(new FetchResponse({
            status: xhr.status,
            error: 'Request Timeout'
        }));
    };
    xhr.send();

    return promise;
}

/**
 * Fetch response object
 * @interface
 */
export class FetchResponse {
    constructor({status, data, error}) {
        this.status = status;
        this.data = data;
        this.error = error;
    }
}

/**
 * Process responseText and returned parsed or raw content depending on options.responseType
 *
 * @private
 * @param {XMLHttpRequest} xhr - native xhr object
 * @return {*} returns response data
 */
function _processResponse(xhr) {
    var contentType = xhr.getResponseHeader('Content-Type') || '';
    var match = contentType.match(/\w+\/(\w+)/) || [];
    var type = match[1];
    if (type === 'json') {
        return JSON.parse(xhr.responseText);
    }
    return xhr.responseText;
}

import Observer from './observer.js'

export default class JsonView extends Observer {
    init() {
        this.viewName = 'jsonview' + (new Date()).getTime();
    }
    onUpdate(data) {
        if (!this.viewName) {
            throw 'viewName field is required';
        }

        var element = document.querySelector('.' + this.viewName);
        if (!element) {
            element = document.createElement('div');
            element.className = this.viewName;
            document.body.appendChild(element);
        }
        element.innerHTML = '<pre><h3>' + this.viewName + '</h3><br>' + JSON.stringify(data, null, 4);
    }
}

export default class Observer {
    constructor() {
        this._subscribtionList = [];
    }
    subscribe(event, target, callbackName) {
        var callback = target[callbackName].bind(target);
        if (__DEV__) {
            console.log('subscribeing to event "', event, '" of observer: ', this.constructor.name);
        }
        this._subscribtionList.push({ event, callback });
    }
    unsubscribe(event, callback) {
        if (__DEV__) {
            console.log('unsubscribeing of event "', event, '" of observer: ', this.constructor.name);
        }
        this._subscribtionList = this._subscribtionList.filter((subscribtion) => {
            return (subscribtion.event !== event && subscribtion.callback !== callback);
        });
    }
    fire(event, ...args) {
        if (__DEV__) {
            console.log('firing event "', event, '" with args: ', JSON.stringify(args));
        }
        this._subscribtionList.forEach((subscribtion) => {
            if (subscribtion.event === event) {
                if (__DEV__) {
                    console.log('found event "', event, '" handler - calling callback');
                }
                subscribtion.callback.apply(this, args);
            }
        });
    }
}

export default class SimplePromise {
    constructor() {
        this.isResolved = false;
        this.data = null;
        this.successCallbacks = [];
        this.rejectCallbacks = [];
    }
    resolve(data) {
        if (!this.isResolved) {
            this.processCallbacks(this.successCallbacks, data);
        }
    }
    reject(data) {
        if (!this.isResolved) {
            this.processCallbacks(this.rejectCallbacks, data);
        }
    }
    processCallbacks(callbacks, data) {
        this.isResolved = true;
        this.data = data;
        callbacks.forEach((callback) => callback(data));
    }
    then(callback) {
        if (this.isResolved) {
            callback(this.data);
        } else {
            this.successCallbacks.push(callback);
        }
        return this;
    }
    fail(callback) {
        if (this.isResolved) {
            callback(this.data);
        } else {
            this.rejectCallbacks.push(callback);
        }
        return this;
    }
}

